import{_ as d}from"./chunks/network.SCBJzEcF.js";import{_ as e,c as o,o as r,ae as c}from"./chunks/framework.Dgg8-8ov.js";const u=JSON.parse('{"title":"Network 界面","description":"","frontmatter":{},"headers":[],"relativePath":"docs/gui/network.md","filePath":"docs/gui/network.md"}'),a={name:"docs/gui/network.md"};function s(l,t,i,n,h,p){return r(),o("div",null,t[0]||(t[0]=[c('<h1 id="network-界面" tabindex="-1">Network 界面 <a class="header-anchor" href="#network-界面" aria-label="Permalink to &quot;Network 界面&quot;">​</a></h1><p>查看、管理抓包数据的界面</p><img src="'+d+'" alt="Network 界面" width="1000"><h2 id="filter" tabindex="-1">底部搜索框 <a class="header-anchor" href="#filter" aria-label="Permalink to &quot;底部搜索框{#filter}&quot;">​</a></h2><p>搜索框支持多种高级过滤方式，可通过前缀快速定位特定类型的请求：</p><table tabindex="0"><thead><tr><th>前缀</th><th>过滤目标</th><th>示例</th></tr></thead><tbody><tr><td><code>无前缀</code></td><td>请求 URL</td><td><code>example.com/api</code> <code>/abc=123/i</code></td></tr><tr><td><code>m:pattern</code></td><td>请求方法</td><td><code>m:pos</code> <code>m:/get|post/i</code></td></tr><tr><td><code>h:pattern</code></td><td>请求 / 响应头原始文本</td><td><code>h:image/</code> <code>h:/cookie:\\s*test=123/i</code></td></tr><tr><td><code>H:pattern</code></td><td>请求头 Host 字段</td><td><code>H:example.com</code> <code>H:/test/i</code></td></tr><tr><td><code>b:pattern</code></td><td>请求 / 响应体原始内容</td><td><code>b:&quot;error&quot;:true</code> <code>b:/\\d{3}/</code></td></tr><tr><td><code>i:pattern</code></td><td>客户端 IP 或服务的 IP</td><td><code>i:11.2</code> <code>i:/^11\\.2/</code></td></tr><tr><td><code>s:pattern</code></td><td>响应状态码</td><td><code>s:404</code> <code>s:/5\\d{2}/</code></td></tr><tr><td><code>t:pattern</code></td><td>响应头 Content-Type 内容</td><td><code>t:json</code> <code>t:/html|xml/i</code></td></tr><tr><td><code>mark:pattern</code></td><td>右键菜单手动 Mark 的请求 URL</td><td><code>mark:example.com</code> <code>mark:/\\d{5}/</code></td></tr><tr><td><code>app:pattern</code></td><td>按 APP 名称过滤</td><td><code>app:wechat</code> <code>app:chrome</code></td></tr><tr><td><code>fc:pattern</code></td><td>Composer发出的请求 URL</td><td><code>fc:/test/</code> <code>fc:www.test.com</code></td></tr><tr><td><code>e:pattern</code></td><td>出错的请求 URL</td><td><code>e:timeout</code> <code>e:/abort/i</code></td></tr><tr><td><code>style:pattern</code></td><td><a href="./../rules/style.html">style</a> 操作内容</td><td><code>style:italic</code> <code>style:/ita/i</code></td></tr></tbody></table><p><code>pattern</code> 为<strong>关键字</strong>或<strong>正则表达式</strong>，多条件 &quot;与&quot; 搜索：</p><div class="language-txt vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">txt</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>b:/&quot;success&quot;:false/ m:POST s:200 H:api.example.com</span></span></code></pre></div><h2 id="settings" tabindex="-1">Settings <a class="header-anchor" href="#settings" aria-label="Permalink to &quot;Settings&quot;">​</a></h2><p><strong>Exclude Filter</strong>（排除过滤器） 和 <strong>Include Filte</strong>（包含过滤器） 允许对未在 Network 显示过的抓包数据进行精细化筛选，支持多条件组合过滤：</p><table tabindex="0"><thead><tr><th><strong>过滤类型</strong></th><th><strong>作用</strong></th><th></th></tr></thead><tbody><tr><td><strong>Include Filter</strong></td><td><strong>只保留</strong>满足条件的请求（相当于白名单）</td><td></td></tr><tr><td><strong>Exclude Filter</strong></td><td><strong>排除</strong>满足条件的请求（相当于黑名单）</td><td></td></tr></tbody></table><ol><li>单个输入框内的条件 <ul><li>分隔方式：用 空格 或 换行符 分隔多个条件</li><li>逻辑关系：条件间是 &quot;或&quot;（OR） 关系</li></ul><blockquote><p>示例：<code>example.com api.test.com</code> → 匹配 example.com 或 api.test.com 的请求</p></blockquote></li><li>多个输入框之间的条件 <ul><li>逻辑关系：不同输入框之间是 &quot;与&quot;（AND） 关系</li><li>示例： <ul><li>Include Filter 输入：<code>m:GET</code></li><li>Exclude Filter 输入：<code>h:/cookie:[^\\r\\n]*test=123/</code></li><li>最终效果：只保留 GET 请求，且排除请求头 cookie 里面包含 <code>test=123</code>的请求</li></ul></li></ul></li></ol><p><strong>支持的过滤条件</strong>：</p><table tabindex="0"><thead><tr><th><strong>语法</strong></th><th><strong>作用</strong></th><th><strong>示例</strong></th></tr></thead><tbody><tr><td><code>无前缀</code></td><td>匹配请求 URL 包含该关键字的请求</td><td><code>.example.com</code></td></tr><tr><td><code>m:pattern</code></td><td>匹配请求方法</td><td><code>m:POST</code>（匹配 POST 请求）</td></tr><tr><td><code>h:pattern</code></td><td>匹配原始请求头</td><td><code>h:/cookie:[^\\r\\n]*test=123/</code>（匹配 cookie）</td></tr><tr><td><code>H:pattern</code></td><td>匹配请求头 Host 字段</td><td><code>H:example.com</code> <code>H:/test/i</code></td></tr><tr><td><code>i:pattern</code></td><td>匹配客户端 IP</td><td><code>i:11.2</code> <code>i:/^11\\.2/</code></td></tr></tbody></table><p>与 Network 列表底部搜索框不同：</p><table tabindex="0"><thead><tr><th><strong>功能</strong></th><th><strong>Network 底部搜索框</strong></th><th><strong>Settings 中的 Filter</strong></th></tr></thead><tbody><tr><td><strong>匹配范围</strong></td><td>请求 + 响应阶段的所有数据</td><td><strong>仅匹配请求阶段</strong>（不包含响应数据）</td></tr><tr><td><strong>生效时机</strong></td><td>实时过滤已显示和未来的请求</td><td><strong>仅对未来新请求生效</strong></td></tr><tr><td><strong>历史数据影响</strong></td><td>可过滤已存在的抓包记录</td><td><strong>不影响已显示的请求</strong></td></tr></tbody></table><p><strong>其它选项：</strong></p><table tabindex="0"><thead><tr><th>项名称</th><th>功能说明</th></tr></thead><tbody><tr><td><strong>Network Columns</strong></td><td>自定义抓包列表显示的列（如状态码、方法、大小等）</td></tr><tr><td><strong>Maximum Rows</strong></td><td>设置同时显示的最大抓包数量（防止内存溢出）</td></tr><tr><td><strong>Viewing only your computer&#39;s requests</strong></td><td>只显示本机发出的请求（过滤其他设备/远程请求）</td></tr><tr><td><strong>ViewAll in new window</strong></td><td>点击&quot;View All&quot;时在新窗口打开完整内容（适合大响应体查看）</td></tr><tr><td><strong>Show Tree View</strong></td><td>以树状结构展示请求（按域名/路径分组）</td></tr></tbody></table><h2 id="detail" tabindex="-1">详情面板 <a class="header-anchor" href="#detail" aria-label="Permalink to &quot;详情面板{#detail}&quot;">​</a></h2><ol><li>Overview：匹配的规则及请求的一些基本信息</li><li>Inspectors：请求/响应头及内容的详细信息</li><li>Timeline：请求的性能信息</li><li>Composer：<a href="./https.html">Componser 界面</a></li><li>Tools：一些工具 <ul><li>Console：显示远程界面 console 日志的平台，详见：<a href="./console.html">Console</a></li><li>Server：Whistle 运行过程发生的一些异常</li><li>Toolbox：一些常用的工具方法</li></ul></li></ol><h2 id="其它菜单" tabindex="-1">其它菜单 <a class="header-anchor" href="#其它菜单" aria-label="Permalink to &quot;其它菜单&quot;">​</a></h2><ol><li>Replay：重新请求选中的抓包数据</li><li>Edit：将抓包数据填充到右侧的 Composer</li><li>右上角箭头按钮：切换到上下面板的模式，适合竖屏显示器</li></ol>',22)]))}const b=e(a,[["render",s]]);export{u as __pageData,b as default};
